import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {
   const q = props.getquestionid(2)
    console.log(props);
    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.id}</p>
            <p>{props.question.title}</p>

        </Paper>
    )
}

export default Question;
